캠핑과는 다른 용도로 구입하였는데.. 집에 아이둘을 키우고 있어 장난감 넣을 박스 겸 빈백쇼파 곁에 둘 테이블로 구입했어요. 장난감 두기에도 좋고 커피나 읽던 책 올려두기도 좋고, (저도 아이들도) 책장 위에 있는 장난감 꺼낼 때 발판으로도 사용합니다;;

나중에 애들 커서 장난감 졸업하면 캠핑 박스와 테이블로 사용하려고요. 단단하고 균형감 있어요.

빠른배송과 합리적인 가격은 매번 만족하고 감사하고 있습니다.

배송와서 물건 확인 해봤는데요 위에 표면에 찍혀있고
다리도 양쪽 다르게 한쪽이더 안으로 들어가듯이 비슴하게
되어있네요 ;;

조립전에는 반신반의;;
조립하다보니 조립도 어렵지 않고 마치고 나니 용량도 견고함도 만족합니다
외부의 물건들 정리하기 좋습니다

갓갓프갓임 ;;; 완전 맘에 듭니다.

이정도 가격에 이정도 크기 이정도 편의성;;

갓이갓갓임

상판 넓어서 좋고 음식물 떨어져도 물이 금방 들지 않아서 좋네요~하지만 다리를 접었다 폈다 하는게 너무 뻑뻑해서 저는 펴고 접는게 안되고 남편만 할수 있다는게 불편합니다~~
펴 놓고 사용하는데는 좋을듯하나 필요시에만 펴고 사용하려던 저한테는 아니라는 생각이....;;
그래서 별 두개 뺍니다

상품은 사용해봐야 하겠지만 일단 상품 받자마자 택배비를 현금으로 받아가는 상황이 어이가 없네요...

확인해보니 상품상세 설명에 착불배송이라고 되어 있네요... ㅡㅡ;;

그냥 구매 단계에세 택배비를 받으세요~

전에 사무실서 필요해 주문해 구매해 받아보시고 좋아하셨는데
지인분이 필요하시다고 하셔서 제구매 해드렸네요. 다만족해하셨어요. 다만 제생각인데 조금만 가벼웠으면 합니다.
여자혼자 하기엔 넘 무거워서요 ~^^;;

이거 740까지 높이가 되는건 줄 알고 샀는데
무릎높이에서 안올라오네요 ;;;;;
저만 안되는건가요
